import React from 'react'
import Sidebar from '../Navbar/Sidebar';
import HomeVideos from './HomeVideos';
const Home = () => {
  return (

    <div className="flex">
    <div className="fixed top-15 left-0 ">
        <Sidebar />
      </div>
      <div className="ml-64 flex-grow p-4">
        <HomeVideos />
      </div>
    </div>
  )
}

export default Home;
